@hoperisesnetwork , @nerdsgonewild , and @paulas_donuts_official join forces this holiday season for the “NERDS GONE GIVING” Toy Drive!
Please donate new, unwrapped toys of any amount to support WNY families in need this holiday season. You can donate through 12/20/2023 at all Paula’s Donuts locations, at @lakeeffectfurniture , and at @stolatbar .
Thank you, and happy holidays! 😊🤓🎁
